import React, { Component } from "react";
import "./style.css";
import InIcon from "./assets/bills-stack.png";

class InCard extends Component {
    render() {
        return (
            <div>
                <div class="card">
                <img class="responsive-img" style={{width: 50 , marginLeft:20 ,marginTop:20 }} src={InIcon}></img>
                    <h4>Money Inbox</h4>
                    <div class="card-content">
                        <p>I am a very simple card. I am good at containing small bits of information. I am convenient because I require little markup to use effectively.</p>
                    </div>
                </div>
            </div>
        );
    }
}

export default InCard;
